import React from 'react';
import { useNavigate } from 'react-router-dom';
import '../../assets/css/profilePage.css';

function ProfilePage() {

    const navigate = useNavigate();

    const handleRedirect = (page) => {
        // Redirect to a new page
        console.log(page);
        switch(page){
        case 'work':
            navigate('/new-page');
        }
      };

    return (
        <div className='profile-page'>
            <button onClick={handleRedirect("work")} >click me</button>
            {/* Header - 4 button
            Country-Tab
            Name-scroll
            BG image with short desc*/}
            <div className = "headerButtonContainer">
                <button className = "headerButton" onClick={handleRedirect("work")}>Work</button>
                <button className = "headerButton" onClick={handleRedirect("about")}>About</button>
                <button className = "headerButton" onClick={handleRedirect("contact")}>Contact</button>
            </div>

            <marquee scrollamount="10" direction = "left" className="scroll-name"> - fahima farook - fahima farook - fahima farook - fahima farook</marquee>
        </div>
    );
}

export default ProfilePage;
